import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  cardRoot: {
    // Temporary
    width: 235,

    position: 'relative',
    height: 234,
    borderRadius: 12,
    padding: 10,
  },
  cardContentRoot: {
    padding: 10,
  },
  cardActRoot: {
    position: 'absolute',
    bottom: 0,
    left: 0,
  }
})

export default styles
